Content:
Kalo iya, Intinya yang dibawa dari Saussure ke Modern Semiotics dan Hermeneutics itu pemisahan antara Langue vs Parole, Signified/Signifier; 

1) Language as a kind of "superstructure"  (langue), vs
2) Language as it is used in "speech"  - text, speech as in pidato, singing, etc  (parole). You can check Theory of Speech Act to explore in simpler way.
